import React from 'react';
import './style.css';

class Body extends React.Component {
  render = ()=>{
    return (
      <div className='body'>
        <h1 id="about" className='header'>About</h1>
        <div className="section">
          Neil is a <b>sophomore</b> at the <b>University of California, Los Angeles (UCLA)</b>
        </div>
      </div>
    );
  }
}

export default Body;
